import React from 'react';
import Marker from '../components/Marker'


const MarkerList = ( {markerArray, selectedMarkers, onMarkerClick}) => {
	return (
		<div><h2>Marker List</h2>
			{markerArray.map( m => <Marker {...m} 
										key={m.properties.kioskID} 
										onClick={() => onMarkerClick(m.properties.kioskID, selectedMarkers.includes(m.id))}
										active={selectedMarkers.includes(m.properties.kioskID)}/>)}
		</div>
	)
}

export default MarkerList
